import React, { Component } from "react";
import "./Mentor.css";

class Mentor extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="mentor">
        <div className="mentor-text"></div>
      </div>
    );
  }
}

export default Mentor;
